import { StyleSheet, Text, View } from 'react-native'
import React from 'react';
import Header from '../components/Header';


const ShoppingScreen = () => {
  return (
    <View>
      <Header/>
    </View>
  )
}

export default ShoppingScreen

const styles = StyleSheet.create({})
